import "./App.css";
import React, { useState, useEffect } from "react";

// Pages
import { Login } from "./pages/Login";
import { Todo } from "./pages/Todo";

// Router
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";

function App() {
  return (
    <>
      <Router>
        <Switch>
          <Route path="/login">
            <Login />
          </Route>
          <Route element={Todo} path="/" exact />
        </Switch>
      </Router>
    </>
  );
}

export default App;
